// ==UserScript==
// @name           Warchaos Astar
// @namespace      https://github.com/shazgorn/warchaos_userjs
// @description    You can move your units like in heroes game
// @match          http://warchaos.ru/f/a
// @version        1.38
// @downloadURL    https://raw.github.com/shazgorn/warchaos_userjs/master/wc_astar.user.js
// ==/UserScript==

//TODO: exit from dropship zeroes AP
(function() {
    "use strict";
    function source() {
        (function astar_module() {
            /* GLOBALS */
            var idRg = /(\d+).gif/,
                    coordsRg = /(\d+) y:(\d+)/,
                    krakenRg = /кря|кра/i,
                    prevDestX = 0,
                    prevDestY = 0,
                    moving = false,
                    greenArrows = "data:image/png;base64,",
                    brownArrows = "data:image/png;base64,",
                    redArrows = "data:image/png;base64,",
                    finishIco = "data:image/png;base64,";

            function addScript(src) {
                var scripts = document.getElementsByTagName("script"), i, script;
                for (i = 0; i < scripts.length; i++) {
                    if (scripts[i].getAttribute("src") === src) {
                        return;
                    }
                }
                script = document.createElement("script");
                script.src = src;
                document.head.appendChild(script);
            }

            function Unit(img) {
                if (img) {
                    this.img = img;
                    this.id = img.getAttribute("src").match(idRg)[1];
                    this.relation = 0;
                } else {
                    return null;
                }
            }
            Unit.prototype.isWaterborne = function() {
                if (this.id == 9252 || this.id == 9032 || this.id == 9262 || this.id == 9042 || this.id == 9242 ||
                        this.id == 9232 || this.id == 9052)
                    return true;
                return false;
            };
            Unit.prototype.isAfraidOfKraken = function() {
                if (this.id == 9252 || this.id == 9032 || this.id == 9262 || this.id == 9232)
                    return true;
                return false;
            };
            Unit.prototype.isDropship = function() {
                if (this.id == 9242 || this.id == 242)
                    return true;
                return false;
            };
            Unit.prototype.isKogg = function() {
                if (this.id == 9042)
                    return true;
                return false;
            };
            Unit.prototype.isAirborne = function() {
                if (this.id == 9122 || this.id == 122)
                    return true;
                return false;
            };
            Unit.prototype.isVehicle = function() {
                if (this.id == 9152 || this.id == 9102 || this.id == 9062 || this.id == 9092 || this.id == 142 || this.id == 9172 || this.id == 9212)
                    return true;
                return false;
            };
            Unit.prototype.isStavka = function() {
                if (this.id == 142)
                    return true;
                return false;
            };
            Unit.prototype.isHero = function() {
                if (this.id == 9000)
                    return true;
                return false;
            };
            Unit.prototype.isInfranty = function() {
                if (parseInt(this.id / 1000, 10) == 9 && this.id % 10 === 0)
                    return true;
                return false;
            };
            Unit.prototype.isSurfaceborne = function() {
                if (this.isVehicle() || this.isInfranty())
                    return true;
                return false;
            };
            Unit.prototype.isAssassin = function() {
                if (this.id == 9180)
                    return true;
                return false;
            };
            Unit.prototype.isElephant = function() {
                if (this.id == 9150)
                    return true;
                return false;
            };
            Unit.prototype.isTown = function() {
                if (this.id == 23 || this.id == 13 || this.id == 3)
                    return true;
                return false;
            };
            Unit.prototype.isMarker = function() {
                if (this.id == 206 || this.id == 56 || this.id == 76)
                    return true;
                return false;
            };
            Unit.prototype.isKraken = function() {
                if (this.id == 182)
                    return true;
                else if (this.isMarker()) {
                    var m = this.img.getAttribute("tooltip").match(/<i>(.*)<\/i>/);
                    if (m && m[1].search(krakenRg) != -1)
                        return true;
                }
                return false;
            };
            Unit.prototype.isMine = function() {
                if (this.img.parentNode.childNodes.length == 3 && this.img.parentNode.childNodes[2].hasAttribute("class") &&
                        this.img.parentNode.childNodes[2].getAttribute("class") == "ind0")
                    return true;
                return false;
            };
            Unit.prototype.isCoffin = function() {
                if (this.id == 340)
                    return true;
                return false;
            };
            Unit.prototype.isClan = function() {
                if (this.img.parentNode.childNodes.length == 3 && this.img.parentNode.childNodes[2].hasAttribute("class") &&
                        this.img.parentNode.childNodes[2].getAttribute("class") == "ind1")
                    return true;
                return false;
            };
            Unit.prototype.isAlly = function() {
                if (this.img.parentNode.childNodes.length == 3 && this.img.parentNode.childNodes[2].hasAttribute("class") &&
                        this.img.parentNode.childNodes[2].getAttribute("class") == "ind3")
                    return true;
                return false;
            };
            Unit.prototype.isHostile = function() {
                if (!this.isMarker() && !this.isHero() && !this.isDropship() && !this.isKogg() && !this.isAirborne() &&
                        this.img.parentNode.childNodes.length == 3 && this.img.parentNode.childNodes[2].hasAttribute("class") &&
                        this.img.parentNode.childNodes[2].getAttribute("class") == "ind4")
                    return true;
                return false;
            };
            Unit.prototype.isRainbow = function() {
                if (this.id == 35)
                    return true;
                return false;
            };
            Unit.prototype.isBush = function() {
                if (this.id == 25)
                    return true;
                return false;
            };
            Unit.prototype.isWeb = function() {
                if (this.id == 95)
                    return true;
                return false;
            };
            Unit.prototype.isDebris = function() {
                if (this.id == 2)
                    return true;
                return false;
            };
            Unit.prototype.isPassable = function() {
                if (this.isMarker() || this.isCoffin() || this.isRainbow() 
                        || this.isBush() || this.isWeb() || this.isDebris()
                        ) {
                    return true;
                }
                return false;
            };
            Unit.prototype.moves = function findMoves() {
                var fonts = document.getElementsByTagName("font");
                for (var i = 0; i < fonts.length; i++) {
                    if (fonts[i].innerHTML == "Ходы:") {
                        return parseFloat(fonts[i].parentNode.nextSibling.innerHTML);
                    }
                }
                return -1;
            };
            Unit.prototype.isSprinter = function() {
                if ($("img[src='355.gif'][class='mut1']").length == 1)
                    return true;
                return false;
            };

            function Node(x, y, cell, i, j, map) {
                this.x = x;
                this.y = y;
                this.state = 0; // 0 - unexplored, 1 - open, 2 - close
                this.cost = 1;  // cost to step into this node
                this.g = 0;
                this.h = 0; // heuristic
                this.f = 1;
                this.parent = null;
                this.cell = cell;
                this.i = i;
                this.j = j;
                this.accessible = 0;
                this.map = map;
                this.enemyOnAdjCell = null;
                this.terrainType = 0; // 0 - undefined, 1 - ground, 2 - road, 3 - forest, 4 - mountain, 5 - swamp, 6 - water, 7 - wall
                this.obj = null;
                this.bg = null;
                this.cult = sessionStorage.getItem("cult") === null ? "" : sessionStorage.getItem("cult");
                if (this.cell.hasAttribute("background")) {
                    this.bg = this.cell.getAttribute("background").match(idRg)[1];
                    this.obj = new Unit(this.cell.childNodes[0]);
                } else {
                    this.bg = this.cell.childNodes[0].getAttribute("src").match(idRg)[1];
                }
                if (this.bg >= 48 && this.bg <= 58)
                    this.terrainType = 1;
                else if (this.bg >= 96 && this.bg <= 110)
                    this.terrainType = 2;
                else if (this.bg >= 64 && this.bg <= 78)
                    this.terrainType = 3;
                else if (this.bg >= 80 && this.bg <= 84)
                    this.terrainType = 4;
                else if (this.bg >= 112 && this.bg <= 119)
                    this.terrainType = 5;
                else if (this.bg >= 32 && this.bg <= 47)
                    this.terrainType = 6;
                else if ((this.bg >= 1088 && this.bg <= 1098) || (this.bg >= 240 && this.bg <= 250))
                    this.terrainType = 7;
                // calc cost
                if (this.activeUnit.isStavka()) {
                    if (this.isRoad())
                        this.cost = 0.5;
                    else
                        this.cost = 1;
                } else if (this.activeUnit.isSurfaceborne()) {
                    if (this.isGround())
                        this.cost = 1;
                    else if (this.isMountain())
                        this.cost = 3;
                    else if (this.isForest())
                        if (this.activeUnit.isElephant())
                            this.cost = 3;
                        else if (this.activeUnit.isVehicle()) {
                            this.cost = 2;
                        } else if (this.cult == "лесов")
                            this.cost = 1;
                        else
                            this.cost = 2;
                    else if (this.isSwamp())
                        this.cost = 2;
                    else if (this.isRoad())
                        this.cost = this.cult == "лесов" &&
                                !(this.activeUnit.isVehicle()) ? 1 : 0.5;
                    if (this.obj !== null) {
                        if (this.obj.isTown()) {
                            this.cost = 0.5;
                        } else if (this.obj.isStavka()) {
                            this.cost = 1;
                        } else if (!this.activeUnit.isVehicle() && this.obj.isBush()) {
                            this.cost += this.cult == "силы" ? 2 : 4;
                        } else if (!this.activeUnit.isVehicle() && this.obj.isWeb()) {
                            this.cost += parseFloat((this.cult == "силы" ? (this.activeUnit.moves() - this.cost) / 4 :
                                    (this.activeUnit.moves() - this.cost) / 2).toFixed(1)); // this bogus, and works only for adj cell
                        }
                    }
                } else if (this.activeUnit.isWaterborne()) {
                    this.cost = 0.25;
                } else if (this.activeUnit.isAirborne()) {
                    this.cost = 1;
                }
                // calc accessible
                if (this.activeUnit.isSurfaceborne()) {
                    if (this.isWater() || this.isWall()) {
                        this.accessible = 0;
                    } else if (this.obj !== null) {
                        if (this.obj.isTown() && (this.obj.isMine() || this.activeUnit.isHero())) {
                            this.accessible = 1;
                        } else if (this.obj.isPassable())
                            this.accessible = 1;
                        else
                            this.accessible = 0;
                    } else {
                        this.accessible = 1;
                    }
                } else if (this.activeUnit.isWaterborne()) {
                    if (this.isWater()) {
                        if (this.obj === null) {
                            this.accessible = 1;
                        } else {
                            if (this.obj.isPassable())
                                this.accessible = 1;
                            else
                                this.accessible = 0;
                        }
                    } else
                        this.accessible = 0;
                } else if (this.activeUnit.isAirborne()) {
                    if (this.obj === null || this.obj.isPassable()) {
                        this.accessible = 1;
                    } else {
                        this.accessible = 0;
                    }
                }
            }
            Node.prototype.activeUnit = null;		// will be calculated in astar function
            Node.prototype.nodes = null;			// all nodes
            Node.prototype.isGround = function() {
                if (this.terrainType == 1)
                    return true;
            };
            Node.prototype.isRoad = function() {
                if (this.terrainType == 2)
                    return true;
            };
            Node.prototype.isForest = function() {
                if (this.terrainType == 3)
                    return true;
            };
            Node.prototype.isMountain = function() {
                if (this.terrainType == 4)
                    return true;
            };
            Node.prototype.isSwamp = function() {
                if (this.terrainType == 5)
                    return true;
            };
            Node.prototype.isWater = function() {
                if (this.terrainType == 6)
                    return true;
            };
            Node.prototype.isWall = function() {
                if (this.terrainType == 7)
                    return true;
            };

            Node.prototype.getAdjCell = function(dx, dy) {
                if ((this.i + dy >= 0) && (this.i + dy < this.nodes.length) &&
                        (this.j + dx >= 0) && (this.j + dx < this.nodes[0].length)) {
                    return this.nodes[this.i + dy][this.j + dx];
                }
                return null;
            };
            Node.prototype.getAdjCells = function() {
                var order = [0, -1, 1],
                        adjCells = [],
                        adjCell;
                for (var i = 0; i < 3; i++)
                    for (var j = 0; j < 3; j++)
                        if (!(i === 0 && j === 0)) {
                            adjCell = this.getAdjCell(order[i], order[j]);
                            if (adjCell !== null)
                                adjCells.push(adjCell);
                        }
                return adjCells;
            };
            Node.prototype.checkForEnemyOnAdjCell = function() {
                var adjCells = this.getAdjCells();
                if (this.enemyOnAdjCell === null) {
                    for (var i = 0; i < adjCells.length; i++) {
                        if (adjCells[i].obj !== null && adjCells[i].obj.isHostile()) {
                            this.enemyOnAdjCell = true;
                            break;
                        }
                    }
                }
                return this.enemyOnAdjCell;
            };
            Node.prototype.addAdjCellsToOpenList = function(openList) {
                var adjCells = this.getAdjCells();
                for (var i = 0; i < adjCells.length; i++) {
                    var el = adjCells[i];
                    if (!this.activeUnit.isHero() && !this.activeUnit.isAssassin() && this.enemyOnAdjCell && el.enemyOnAdjCell)
                        continue;
                    // check in openList for present in there
                    if (el !== null && el.accessible) {
                        if (el.state == 1) {
                            if (el.g > el.parent.g + el.cost) {
                                el.parent = this;
                            }
                        }
                        if (el.state === 0 && openList.indexOf(el) == -1) {
                            el.state = 1;
                            el.parent = this;
                            el.cell.setAttribute("class", "open");
                            // el.h = Math.max(Math.abs(finish.x - el.x), Math.abs(finish.y - el.y)) - 2;
                            // el.h = 0;
                            if (el.parent !== null) {
                                el.g = el.parent.g + el.cost;
                            }
                            el.f = el.h + el.g;
                            openList.push(el);
                        }
                    }
                }
            };


            function findMinNode(openList) {
                var min = Number.MAX_VALUE, minNode = null;
                for (var i = 0; i < openList.length; i++) {
                    if (openList[i].f < min) {
                        min = openList[i].f;
                        minNode = openList[i];
                    }
                }
                return minNode;
            }



            function astar(destX, destY) {
                if (typeof destX === "undefined" || typeof destY === "undefined") {
                    destX = 0;
                    destY = 0;
                }
                var map = window.top.document.getElementById("dmap").getElementsByTagName("table")[1];
                $(map).find("td").attr("style", "overflow:hidden;");
                $("img[src='" + greenArrows + "']").remove();
                $("img[src='" + redArrows + "']").remove();
                $("img[src='" + brownArrows + "']").remove();
                $("img[src='" + finishIco + "']").remove();
                var nodes = [];
                Node.prototype.nodes = nodes;
                var activeUnit = new Unit($("button[class='but40'][onclick='cm6();'] img").get(0));
                Node.prototype.activeUnit = activeUnit;
                var i, j, k;
                for (i = 0; i < map.rows.length; i++) {
                    nodes.push([]);
                    for (j = 0; j < map.rows[i].cells.length; j++) {
                        var cell = map.rows[i].cells[j];
                        var match = cell.childNodes[0].getAttribute("tooltip").match(coordsRg);
                        var node = new Node(parseInt(match[1], 10), parseInt(match[2], 10), cell, i, j, map);
                        match = parseInt(cell.childNodes[0].getAttribute("src").match(idRg)[1], 10);
                        nodes[nodes.length - 1].push(node);
                    } // for cells
                } // for rows
                // check for enemies
                var adjCells;
                for (i = 0; i < nodes.length; i++)
                    for (j = 0; j < nodes[i].length; j++) {
                        if (nodes[i][j].obj !== null && nodes[i][j].obj.isHostile()) {
                            adjCells = nodes[i][j].getAdjCells();
                            for (k = 0; k < adjCells.length; k++) {
                                adjCells[k].enemyOnAdjCell = true;
                            }
                        }
                    }
                // search for krakens
                if (activeUnit.isAfraidOfKraken()) {
                    for (i = 0; i < nodes.length; i++)
                        for (j = 0; j < nodes[i].length; j++)
                            if (nodes[i][j].obj !== null) {
                                if (nodes[i][j].obj.isKraken()) {
                                    nodes[i][j].accessible = 0;
                                    adjCells = nodes[i][j].getAdjCells();
                                    for (k = 0; k < adjCells.length; k++) {
                                        adjCells[k].accessible = 0;
                                    }
                                }
                            }
                }
                var curI = parseInt(nodes.length / 2, 10), curJ = parseInt(nodes[parseInt(nodes.length / 2, 10)].length / 2, 10);
                var start = nodes[curI][curJ];
                var finish = null;
                for (i = 0; i < nodes.length; i++) {
                    for (j = 0; j < nodes[i].length; j++) {
                        if (nodes[i][j] !== null && nodes[i][j].accessible && nodes[i][j].x == destX && nodes[i][j].y == destY) {
                            finish = nodes[i][j];
                        }
                    }
                }
                if (finish === null) {
                    prevDestX = 0;
                    prevDestY = 0;
                    return null;
                }
                finish.accessible = 1;
                var openList = [];
                var closeList = [];
                start.state = 1;
                start.accessible = 1;
                openList.push(start);
                var curNode = null;
                for (var loops = 0; loops < 800; loops++) {
                    curNode = findMinNode(openList);
                    if (curNode !== null) {
                        openList.splice(openList.indexOf(curNode), 1);
                        curNode.state = 2;
                        closeList.push(curNode);
                        if (curNode === finish)
                            break;
                        curNode.addAdjCellsToOpenList(openList);
                    } else {
                        break; // you can`t access that node
                    }
                }
                var sum = 0;
                curNode = finish;
                var moves = activeUnit.moves();
                while (curNode !== start && curNode !== null && finish.parent !== null) {
                    sum += curNode.g;
                    var img = document.createElement("img");

                    if (curNode === finish) {
                        img.setAttribute("src", finishIco);
                        if (curNode.g <= moves) {
                            if (curNode.checkForEnemyOnAdjCell() === true) {
                                img.setAttribute("style", "display:block;position:relative;top:0px;left:20px;margin:-40px -20px 0px;");
                            } else
                                img.setAttribute("style", "display:block;position:relative;top:0px;left:20px;margin:-40px -20px 0px;");
                        }
                        else
                            img.setAttribute("style", "display:block;position:relative;top:0px;left:-20px;margin:-40px -20px 0px;");
                    }
                    else {
                        if (curNode.g <= moves) {
                            if (curNode.checkForEnemyOnAdjCell() === true) {
                                img.setAttribute("src", redArrows);
                            } else {
                                img.setAttribute("src", greenArrows);
                            }
                        } else {
                            img.setAttribute("src", brownArrows);
                        }
                        var dy = curNode.i - curNode.parent.i + 1,
                                dx = curNode.j - curNode.parent.j + 1,
                                arrs = [
                                    [[20, 40], [20, 0], [20, -40]],
                                    [[-20, 40], [-20, 0], [-20, -40]],
                                    [[-60, 40], [-60, 0], [-60, -40]]
                                ];
                        img.setAttribute("style", "display:block;position:relative;top:" + arrs[dy][dx][0] + "px;left:" + arrs[dy][dx][1] + "px;margin:-60px;");
                    }
                    img.setAttribute("tooltip", curNode.cell.childNodes[0].getAttribute("tooltip") + "</br>" + curNode.g + " (" + (moves - curNode.g).toFixed(1) + ")");
                    curNode.cell.appendChild(img);
                    if (curNode.parent === start) {
                        return curNode;
                    } else {
                        curNode = curNode.parent;
                    }
                }
            } // function astar

            if (typeof $ === "undefined") {
                addScript("http://code.jquery.com/jquery-1.9.1.js");
            }
            if (typeof $ === "undefined") {
                setTimeout(astar_module, 1000);
                return;
            }

            addEventListener("click", function(e) {
                var m;
                moving = false;
                if (e.altKey || e.shiftKey || e.ctrlKey || e.button == 2 || e.target.hasAttribute("class")) {
                    prevDestX = 0;
                    prevDestY = 0;
                } else if (e.target.getAttribute("src") == finishIco) {
                    m = e.target.parentNode.childNodes[0].getAttribute("tooltip").match(coordsRg);
                    if (prevDestX == parseInt(m[1], 10) && prevDestY == parseInt(m[2], 10)) {
                        moving = true;
                        move(false);
                    } else {
                        prevDestX = 0;
                        prevDestY = 0;
                    }
                } else if (e.target.parentNode.hasAttribute("background")) {
                    if ((new Unit(e.target.parentNode.childNodes[0])).isPassable()) {
                        m = e.target.getAttribute("tooltip").match(coordsRg);
                        prevDestX = parseInt(m[1], 10);
                        prevDestY = parseInt(m[2], 10);
                        astar(parseInt(m[1], 10), parseInt(m[2], 10));
                    } else {
                        prevDestX = 0;
                        prevDestY = 0;
                    }
                } else if ((e.target.hasAttribute("tooltip") && !e.target.parentNode.hasAttribute("background"))) {
                    m = e.target.parentNode.childNodes[0].getAttribute("tooltip").match(coordsRg);
                    astar(parseInt(m[1], 10), parseInt(m[2], 10));
                    prevDestX = parseInt(m[1], 10);
                    prevDestY = parseInt(m[2], 10);
                } else {
                    prevDestX = 0;
                    prevDestY = 0;
                }
            }, false);

            function allowMovement(rtooltip) {
                if (window.h1win)
                    return false;
                if (rtooltip && $("font[color='black']").length !== 0) {
                    if ($("font[color='black']").html().search(/ставк|ресурсы|папоротник|предметы|артефакт|разрушен|цель|использовали|обороны|радуга|огненную/i) != -1) {
                        return true;
                    } else if ($("font[color='black']").html().search(/погиб|щупальца/i) != -1) {
                        return false;
                    } else if ($("font[color='black']").html().search("атакованы врагом") != -1) {
                        var m = $("font[color='black']").html().match(/(\d+) урон/);
                        if (m && parseInt(m[1], 10) < 100)
                            return true;
                    }
                    return false;
                }
                return true;
            }
            function move(rtooltip) {
                if (rtooltip === undefined)
                    rtooltip = true;
                if (moving && prevDestX !== 0 && prevDestY !== 0 && allowMovement(rtooltip)) {
                    var nodeToMove = astar(prevDestX, prevDestY);
                    if (nodeToMove && nodeToMove.g <= Node.prototype.activeUnit.moves()) {
                        window.cmIComm(2, nodeToMove.x, nodeToMove.y, '');
                    } else if (nodeToMove === null) {
                        prevDestX = 0;
                        prevDestY = 0;
                        moving = false;
                    }
                } else {
                    prevDestX = 0;
                    prevDestY = 0;
                }
            }
            addEventListener("mousedown", function(e) {
                if (e.button == 2) {
                    prevDestX = 0;
                    prevDestY = 0;
                }
            }, false);
            (function(f) {
                var wc_ifr = document.getElementById("ifr");
                if (wc_ifr) {
                    wc_ifr.addEventListener("load", function() {
                        setTimeout(f, 100);
                    }, false);
                }
            })(move);
            if (sessionStorage.getItem("cult") === null) {
                $.ajax({
                    url: "http://warchaos.ru/user/cult",
                    type: "POST",
                    async: false,
                    success: function(data) {
                        var m = data.match(/Вами выбрана\:<\/b><br><big><font color=#800000>Религия (.+)<\/font>/);
                        if (m) {
                            m[1].toLowerCase();
                            sessionStorage.setItem("cult", m[1].toLowerCase());
                        } else {
                            sessionStorage.setItem("cult", "атеизм");
                        }
                    }
                });
            }
        })(); // astar_module

    }

    var script = document.createElement('script');
    script.textContent = '(' + source + ')();';
    document.body.appendChild(script);
})();
